def brain_init():
    if pp.width < 5 or pp.height < 5:
        pp.pipeOut("ERROR size of the board")
        return
    if pp.width > MAX_BOARD or pp.height > MAX_BOARD:
        pp.pipeOut("ERROR Maximal board size is {}".format(MAX_BOARD))
        return
    pp.pipeOut("OK")


def brain_restart():
    for x in range(pp.width):
        for y in range(pp.height):
            board[x][y] = 0
    global last_point, my_board, k
    last_point = None
    # replay()
    my_board = Board(np.zeros((20, 20)), network=network, explore_prob=0)
    k = 0
    pp.pipeOut("OK")


def isFree(x, y):
    return x >= 0 and y >= 0 and x < pp.width and y < pp.height and board[x][y] == 0


def brain_my(x, y):
    if isFree(x, y):
        global k
        k += 1
        board[x][y] = 1
        my_board.update_board(x, y)
        # replay()

        # a = search_five(my_board, my_board.turn)
        # if a is not None:
        #     k += 1
        #     my_board.update_board(a[0], a[1])
        #     replay()
    else:
        pp.pipeOut("ERROR my move [{},{}]".format(x, y))


def brain_opponents(x, y):
    if isFree(x, y):
        global last_point, k
        last_point = (x, y)
        k += 1
        board[x][y] = 2
        my_board.update_board(x, y)
        # replay()
    else:
        pp.pipeOut("ERROR opponents's move [{},{}]".format(x, y))


def brain_block(x, y):
    if isFree(x, y):
        board[x][y] = 3
    else:
        pp.pipeOut("ERROR winning move [{},{}]".format(x, y))


def brain_takeback(x, y):
    if x >= 0 and y >= 0 and x < pp.width and y < pp.height and board[x][y] != 0:
        board[x][y] = 0
        return 0
    return 2


def brain_turn():
    try:
        if pp.terminateAI:
            return
        # at beginning, no stones
        if not last_point:
            x, y = (int(pp.width / 2), int(pp.height / 2))
            my_board.update_board(x, y)
            pp.do_mymove(x, y)
            return

        action = None
        B = TSS(my_board)
        actions = B.solve()
        # logDebug('this is TSS:' + str(actions))
        if len(actions) == 1:
            action = actions[0]
        elif len(actions) > 1:
            _, action = my_board.Q_value(legal_actions=actions)
        # logDebug('this is TSS:' + str(action))
        if not action:
            if pp.info_time_left < 10000:
                action = my_board.e_greedy(e=0)
            else:
                action = my_board.minimax()
            # logDebug('this is foolish network' + str(action))
        x, y = action
        pp.do_mymove(x, y)
    except:
        pass
        # logTraceBack()


def brain_end():
    pass


def brain_about():
    pp.pipeOut(pp.infotext)


